export const BooksSettings = {
 MAIN: {
   article: `cities__place-card`,
   image: {
     imageClass: `cities__image-wrapper`,
     width: 260,
     height: 200,
   },
   info: ``
 },
 NEAR: {
   article: `near-places__card`,
   image: {
     imageClass: `near-places__image-wrapper`,
     width: 260,
     height: 200,
   },
   info: ``
 },
 FAVORITES: {
   article: `favorites__card`,
   image: {
     imageClass: `favorites__image-wrapper`,
     width: 150,
     height: 110,
   },
   info: `favorites__card-info`
 }
};

export const AppRoute = {
 LOGIN: `/login`,
 MAIN: `/`,
 LOGOUT: `/logout`,
 COMMENTS: `/comments`,
 FAVORITES: `/favorites`,
 ERROR: `/error`,
 BOOKPAGE: `/book/:id`,
 READER: `/reader/:id`
}
